// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract SugarNFT is ERC1155, Ownable, ReentrancyGuard {
  struct WhiteList {
    uint256 tierType;
    bool isReceived;
  }
  //Variable for sugar token address
  IERC20 g_token;
  //Variable for whitelisted address with it's tier 
  mapping (address => WhiteList) private g_whitelists;
  //Variable for remaining amount per tier
  mapping (uint256 => uint256) public g_tierRemaining;
  //Variable for price for NFT
  mapping (uint256 => uint256) public g_priceForNFT;
  //Variable for minimum balance per tier
  mapping (uint256 => uint256) public g_minimumBalance;

  //Variable for start selling
  bool public g_startSelling;

  //Variable for max nfts per wallet
  uint256 public g_maxBalance;

  //Variable for Numbers of tier
  uint256 public g_tierNums;

  constructor(address _token) ERC1155("https://ipfs.moralis.io:2053/ipfs/QmWRhbciVKv837abDDbej384XB3e5TQ3t2CdrcvCFpbCCF/"){
    g_startSelling = false;
    g_token = IERC20(_token);
    g_maxBalance = 15;
    g_tierNums = 6;
  }

  function airdrop() external nonReentrant {
    WhiteList storage info = g_whitelists[msg.sender];
    require(!g_startSelling, "Airdrop is already ended");
    require(info.tierType != 0, "You are not winner, so you can't get part in airdrop");
    require(info.isReceived == false, "You've already get free NFT");
    require(g_token.balanceOf(msg.sender) >= g_minimumBalance[info.tierType], "You don't have enough Sugar balance for minting this NFT");

    _mint(msg.sender, info.tierType, 1, "");
    g_tierRemaining[info.tierType] = g_tierRemaining[info.tierType] - 1;
    g_whitelists[msg.sender].isReceived = true;
  }

  function mint(uint256 _type) external payable {
    require(g_startSelling, "Selling is not started yet");
    require(g_tierRemaining[_type] > 0, "Out of supply");
    require(g_token.balanceOf(msg.sender) >= g_minimumBalance[_type], "You don't have enough Sugar balance for minting this NFT");
    require(msg.value == g_priceForNFT[_type], "Not enough funds for minting");
    require(getTotal(msg.sender) < g_maxBalance, "You can't mint anymore.");
    _mint(msg.sender, _type, 1, "");
    g_tierRemaining[_type] = g_tierRemaining[_type] - 1;
  }

  function mintByOwner(address _to, uint256 _type) external onlyOwner {
    require(g_tierRemaining[_type] > 0, "Out of supply");
    _mint(_to, _type, 1, "");
    g_tierRemaining[_type] = g_tierRemaining[_type] - 1;
  }
  function setWhitelist(address _winner, uint256 _type) external onlyOwner {
    WhiteList storage info = g_whitelists[_winner];
    info.tierType = _type;
    info.isReceived = false;
  }
  function uri(uint256 _id) public view virtual override returns (string memory) {
        return string(abi.encodePacked(super.uri(_id), Strings.toString(_id), ".json"));
  }
  function getTotal(address _owner) internal view returns(uint256){
    uint256 totalBalance = 0;
    for(uint i = 1 ; i < 7; i ++) {
      totalBalance += balanceOf(_owner, i);

    }
    return totalBalance;
  }
  function setToken(address _address) external onlyOwner {
    g_token = IERC20(_address);
  }
  function getTotalBalance(address _owner) external view returns(uint256) {
    return getTotal(_owner);
  }
  function getWinnerInfo(address _winner) external view returns(uint256, bool){
    WhiteList memory info  = g_whitelists[_winner];
    return (info.tierType, info.isReceived);
  }
  function setRemainingAmount(uint256 _type, uint256 _amount) external onlyOwner{
    g_tierRemaining[_type] = _amount;
  }
  function getRemainingAmount(uint256 _type) external view returns(uint256) {
    return g_tierRemaining[_type];
  }
  function setPriceForNFT(uint256 _type, uint256 _price) external onlyOwner {
    g_priceForNFT[_type] = _price;
  }
  function getPricePerNFT(uint256 _type) external view returns(uint256) {
    return g_priceForNFT[_type];
  }
  function setMinimumBalance(uint256 _type, uint256 _balance) external onlyOwner {
    g_minimumBalance[_type] = _balance;
  }
  function getMinimumBalance(uint256 _type) external view returns(uint256) {
    return g_minimumBalance[_type];
  }

  function setSellingStatus(bool _flag) external onlyOwner {
    g_startSelling = _flag;
  }
  function getSellingStatus() external view returns(bool) {
    return g_startSelling;
  }
  function getMaxBalance() external view returns(uint256){
    return g_maxBalance;
  }
  function setMaxBalance(uint256 _balance) external onlyOwner {
    g_maxBalance = _balance;
  }
  function withdrawBNB() external onlyOwner {
    uint256 withdrawBalance = address(this).balance;
    payable(msg.sender).transfer(withdrawBalance);
  }

}
